import { Component } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.css']
})
export class NavComponent {


  pages=[
    {link:"#Home", displayName:"Home"},
    {link:"#My Tree", displayName:"My Tree"},
    {link:"#Contacts", displayName:"Contacts"},
    {link:"#Annuaire", displayName:"Annuaire"},
    {link:"#Profil", displayName:"Profil"}
  ]

  constructor() { }

  ngOnInit() : void{ }

}
<nav class="bg-gray-200 dark:bg-green-900 fixed w-full z-20 top-0 left-0 border-b border-gray-300 dark:border-gray-600">
    <div class="max-w-screen-xl flex items-center justify-center mx-auto p-4">
        <ul class="flex space-x-8" *ngFor="let page of pages"><app-nav-element [page]="page"></app-nav-element>
        </ul>
    </div>
</nav>
